import React from 'react';
import icon1 from './Images/icon-1.png';

const Menu4 = () => {
  return (
    <section className='menu4'>
      <h3>
        <span>Our</span> Service
      </h3>
      <p>
        Lorem ipsum dolor sittem ametamngcing elit, per sed do eiusmoad teimpor
        sittem elit inuning ut sed.
      </p>
      <div className='menu44'>
        <div className='menu4cont'>
          <img src={icon1}></img>
        </div>
      </div>
    </section>
  );
};

export default Menu4;
